public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        while(sc.hasNext()){
            String str = sc.nextLine();
            String [] arr = str.split("\\\\");
            int num1 = Integer.parseInt(arr[0].substring(0,arr[0].indexOf("/")));
            int den1 = Integer.parseInt(arr[0].substring(arr[0].indexOf("/") + 1));
            int num2 = Integer.parseInt(arr[2].substring(0,arr[2].indexOf("/")));
            int den2 = Integer.parseInt(arr[2].substring(arr[2].indexOf("/") + 1));
            if(arr[1].equals("+")){
                System.out.println(simplify(num1*den2+num2*den1,den1*den2));
            }else if(arr[1].equals("-")){
                System.out.println(simplify(num1*den2-num2*den1,den1*den2));
            }
        }
    }
    public static String simplify(int num,int den){
        int gcd = gcd(num,den);
        return (num/gcd) + "/" + (den/gcd);
    }
    public static int gcd(int a,int b){
        if(b == 0){
            return a;
        }else{
            return gcd(b,a%b);
        }
    }
}

