interface IntegerStack{
    public Integer push(Integer item);
    public Integer pop();
    public Integer peek();
    public boolean empty();
    public int size();
}

class ArrayListIntegerStack implements IntegerStack{
    ArrayList<Integer> list = new ArrayList<>();

    @Override
    public String toString() {
        System.out.println(list);
        return null;
    }

    @Override
    public Integer push(Integer item) {
        if(item == null){
            return null;
        }
        list.add(item);
        return item;
    }

    @Override
    public Integer pop() {
        if(list.size() == 0){
            return null;
        }
        return list.remove(list.size() - 1);
    }

    @Override
    public Integer peek() {
        if(list.size() == 0){
            return null;
        }
        return list.get(list.size() - 1);
    }

    @Override
    public boolean empty() {
        if(list.size() == 0){
            return true;
        }
        return false;
    }

    @Override
    public int size() {
        return list.size();
    }

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        IntegerStack a = new ArrayListIntegerStack();
        int m = sc.nextInt();
        for(int i = 0; i < m; i++){
            System.out.println(a.push(sc.nextInt()));
        }
        System.out.println(a.peek());
        System.out.println(a.empty() + "," + a.size());
        a.toString();
        int x = sc.nextInt();
        for(int i = 0; i < x; i++){
            System.out.println(a.pop());
        }
        System.out.println(a.peek());
        System.out.println(a.empty() + "," + a.size());
        a.toString();
    }

